  true,\n\t\"url\": null,\n\t\"notes\": \"[Commercial reference buildings](http://en.openei.org/wiki/Commercial_Reference_Buildings
  \"OpenEI Wiki page for Commercial Reference Buildings\") provide complete descriptions
  for whole building energy analysis using [EnergyPlus](http://apps1.eere.energy.gov/buildings/energyplus/energyplus_about.cfm
  \"About EnergyPlus\") simulation software. Included here is data pertaining to the
  reference building type _Supermarket _for each of the [16 climate zones](http://en.openei.org/wiki/Commercial_Reference_Buildings#Climate_Zones_Used_to_Create_Reference_Buildings
  \"Climate Zone Summary\"), and each of three construction categories: new construction,
  post-1980 construction existing buildings, pre-1980 construction existing buildings.rnThe
  dataset includes four key components: building summary, zone summary, location summary
  and a picture. Building summary includes details about: form, fabric, and HVAC.
  Zone summary includes details such as: area, volume, lighting, and occupants for
  all types of zones in the building. Location summary includes key building information
  as it pertains to each climate zone, including: fabric and HVAC details, utility
  costs, energy end use, and peak energy demand.rnIn total, DOE developed [16 reference
  building types](http://en.openei.org/wiki/Commercial_Reference_Buildings#Building_Types
  \"OpenEI Wiki Reference Building Types List\") that represent approximately 70%
  of commercial buildings in the U.S.; for each type, building models are available
  for each of the three construction categories. The commercial reference buildings
  (formerly known as commercial building benchmark models) were developed by the [U.S.
  Department of Energy (DOE)](http://en.openei.org/wiki/United_States_Department_of_Energy
  \"OpenEI Wiki page for DOE\"), in conjunction with three of its national laboratories.rnAdditional
  data is available directly from DOE's Energy Efficiency & Renewable Energy [(EERE)
  Website](http://www1.eere.energy.gov/buildings/commercial_initiative/reference_buildings.html),
  including EnergyPlus software input files (.idf) and results of the EnergyPlus simulations
  (.html).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
